import "./Mainselect.css";
import data from "./Data3";
import data2 from "../contents/Data2";
import { useState } from "react";
function Selitem(props) {
  const [two, changeTwo] = useState(false);
  console.log("p1");
  let a,
    b,
    c,
    d,
    e = 0,
    f = 1,
    g = 0;
  let one = 1;
  const imgclick1 = () => {
    console.log(a);
    console.log(d);
    e = d;
    d = a;
    a = e;
    e = 0;
    console.log(a);
    console.log(d);
    changeTwo(!two);
  };
  const imgclick2 = () => {
    console.log(b);
    console.log(d);
    e = d;
    d = b;
    b = e;
    e = 0;
    console.log(b);
    console.log(d);
    changeTwo(!two);
  };
  const imgclick3 = () => {
    e = d;
    d = c;
    c = e;
    e = 0;
    changeTwo(!two);
  };
  d = props.index;
  data.properties.map((index) => {
    if (props.index === index.index) {
      if (e === 0) {
        a = index._id;
        e = e + 1;
      } else if (e === 1) {
        b = index._id;
        e = e + 1;
      } else if (e === 2) {
        c = index._id;
        e = 0;
      }
    }
  });
  const changef = () => {
    f = f + 1;
  };
  return (
    <div className="class2">
      <div className="angle">
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[a].picture}
            alt="Loading..."
            onClick={imgclick1}
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[b].picture}
            alt="Loading..."
            onClick={imgclick2}
          />
        </div>
        <div className="angle1">
          <img
            className="angle2"
            src={data.properties[c].picture}
            alt="Loading..."
            onClick={imgclick3}
          />
        </div>
      </div>
      <div className="mainitem">
        <div className="Mainimg">
          if(f===1)
          {
            <img
              src={data2.properties[d].picture}
              className="Mainimg2"
              onLoad="changef"
            />
          }
          else{}
        </div>
      </div>
      <div className="descrp2">
        <p className="txt3">{data.properties[props.index].name}</p>
        <p className="txt2">{data.properties[props.index].cat} Category</p>
        <p className="txt2">{data.properties[props.index].price}/-</p>
        <button className="btn1">Add To Cart</button>
        <br />
        <button className="btn2">Buy</button>
      </div>
    </div>
  );
}
export default Selitem;
